export default class Account {
   public id!: string;
   public username: string;
   public password: string;
   public email: string;
   public role: string;
   public roleB: boolean;

   constructor(
      username: string = '',
      password: string = '',
      email: string = '',
      role: string = ''
   ) {
      this.username = username;
      this.password = password;
      this.email = email;
      this.role = role;
      this.roleB = role.includes("ADMIN");
   }
}
